import React, { useState } from "react";
import {
	Col,
	Row,
	ListGroup,
	Badge,
	Modal,
	Button,
	Form,
} from "react-bootstrap";
import { API_URL } from "../utils/constants";
import axios from "axios";
import swal from "sweetalert";
import numberWithCommas from "../utils/utils";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMinus, faPlus, faTrash } from "@fortawesome/free-solid-svg-icons";

const ModalKeranjang = ({ handleClose, showModal, keranjangDetail, keterangan, tambah, kurang, jumlah,changeHandler, handleSubmit}) => {

	if (jumlah) {
		const keranjang = {
			jumlah: jumlah,
			total_harga: keranjangDetail.total_harga * jumlah,
			product: keranjangDetail,
			keterangan: keterangan
		}

		axios
			.put(API_URL + "keranjangs?id=" +keranjangDetail.product.id, keranjang)
			.then((response) => {
				swal({
					title: "Berhasil Diupdate!",
					icon: "success",
					button: false,
					timer: 1000,
				});
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}

	if (keranjangDetail) {
		return (
			<Modal show={showModal} onHide={handleClose}>
				<Modal.Header closeButton>
					<Modal.Title>
						{keranjangDetail.product.nama} {""}
						<strong>
							({numberWithCommas(keranjangDetail.product.harga)})
						</strong>
					</Modal.Title>
				</Modal.Header>
				<Modal.Body>
					<Form onSubmit={handleSubmit}>
						<Form.Group>
							<Form.Label>
								<p>Total Harga</p>
								<strong>{keranjangDetail.total_harga * jumlah}</strong>
							</Form.Label>
						</Form.Group>
						<Form.Group controlId="exampleForm.ControlInput1">
							<Form.Label>Jumlah Pesan</Form.Label>
							<br/>
							<Button variant="info" className="mr-2" onClick={() => kurang()}>
								<FontAwesomeIcon icon={faMinus}/>
							</Button>
							<strong>{jumlah}</strong>
							<Button variant="info" className="ml-2" onClick={() => tambah()}>
								<FontAwesomeIcon icon={faPlus}/>
							</Button>
						</Form.Group>
						<Form.Group controlId="exampleForm.ControlTextarea1">
							<Form.Label>Keterangan :</Form.Label>
							<Form.Control as="textarea" rows={3}
							name="keterangan"
							placeholder="Contoh: Nasi Setengah, Kuah Dipisah"
							value={keterangan}
							onChange={(event) => {changeHandler(event)}}/>
						</Form.Group>
						<Button variant="secondary" type="submit"  onClick={handleClose}>
							Simpan
						</Button>
					</Form>
				</Modal.Body>

				<Modal.Footer>
					<Button variant="danger" onClick={handleClose}>
						<FontAwesomeIcon icon={faTrash} className="mr-1" />Hapus Pesanan
					</Button>
				</Modal.Footer>
			</Modal>
		);
	} else {
		return (
			<Modal show={showModal} onHide={handleClose}>
				<Modal.Header closeButton>
					<Modal.Title>Kosong</Modal.Title>
				</Modal.Header>
				<Modal.Body>
					Woohoo, you're reading this text in a modal!
				</Modal.Body>
				<Modal.Footer>
					<Button variant="secondary" onClick={handleClose}>
						Close
					</Button>
				</Modal.Footer>
			</Modal>
		);
	}
};

export default ModalKeranjang;
